const sharp = require('sharp'); // You'll need to install: npm install sharp

// Convert your logo to base64 and store it here
const LOGO_BASE64 = 'data:image/png;base64,data:image/png;base64,'; // Replace with your actual logo

async function addWatermark(imageBuffer, logoBase64) {
  try {
    // Extract base64 data
    const logoBuffer = Buffer.from(logoBase64.split(',')[1], 'base64');
    
    // Get image dimensions
    const image = sharp(imageBuffer);
    const { width, height } = await image.metadata();
    
    // Calculate watermark size (5% of image width, maintaining aspect ratio)
    const watermarkWidth = Math.floor(width * 0.05);
    
    // Process logo: resize and make semi-transparent
    const watermarkBuffer = await sharp(logoBuffer)
      .resize(watermarkWidth, null, { 
        fit: 'contain',
        background: { r: 0, g: 0, b: 0, alpha: 0 }
      })
      .png({ quality: 80 })
      .toBuffer();
    
    // Get watermark dimensions
    const watermark = sharp(watermarkBuffer);
    const { width: wmWidth, height: wmHeight } = await watermark.metadata();
    
    // Position watermark in bottom right corner with padding
    const left = width - wmWidth - Math.floor(width * 0.02);
    const top = height - wmHeight - Math.floor(height * 0.02);
    
    // Apply watermark with low opacity
    const watermarkedBuffer = await image
      .composite([{
        input: await sharp(watermarkBuffer)
          .png({ 
            compressionLevel: 9,
            palette: true,
            quality: 80
          })
          .toBuffer(),
        left: left,
        top: top,
        blend: 'over'
      }])
      .png({ quality: 90 })
      .toBuffer();
    
    return watermarkedBuffer;
  } catch (error) {
    console.error('Watermark error:', error);
    return imageBuffer; // Return original if watermarking fails
  }
}

function enhanceJewelryPrompt(originalPrompt, referenceAnalysis = null) {
  // Base catalog photography style
  const catalogStyle = `professional jewelry catalog photography, 3/4 angle view, white background, studio lighting setup with key light, fill light, and rim lighting, high-end commercial photography, crisp focus, detailed texture rendering, sparkling diamonds, lustrous precious metal surfaces, clean composition`;
  
  // Enhanced lighting description
  const lightingDetails = `cinematic lighting with softbox key light at 45 degrees, subtle fill lighting to eliminate harsh shadows, rim lighting to separate subject from background, reflectors to enhance metal shine and diamond brilliance, color temperature 5500K for natural daylight appearance`;
  
  // Technical photography specs
  const technicalSpecs = `shot with macro lens, f/8 aperture for optimal depth of field, professional DSLR camera, RAW processing for maximum detail, high resolution, commercial product photography standards`;
  
  let enhancedPrompt = originalPrompt;
  
  // Add reference context if available
  if (referenceAnalysis) {
    enhancedPrompt = `${originalPrompt}, inspired by reference image elements: ${referenceAnalysis}`;
  }
  
  // Combine all elements
  return `${enhancedPrompt}, ${catalogStyle}, ${lightingDetails}, ${technicalSpecs}`;
}

// Update your generateImageWithVertex function:
async function generateImageWithVertex(prompt, referenceAnalysis = null) {
  const vertexAI = new VertexAI({
    project: process.env.GOOGLE_CLOUD_PROJECT_ID,
    location: 'us-central1',
    credentials: JSON.parse(process.env.GOOGLE_SERVICE_ACCOUNT_KEY)
  });

  const model = vertexAI.getGenerativeModel({
    model: 'imagegeneration@006',
  });

  // Enhance the prompt with catalog photography specifications
  const enhancedPrompt = enhanceJewelryPrompt(prompt, referenceAnalysis);
  
  console.log('Enhanced prompt:', enhancedPrompt);

  const request = {
    contents: [{
      role: 'user',
      parts: [{
        text: enhancedPrompt
      }]
    }],
    generationConfig: {
      temperature: 0.4,
      topK: 32,
      topP: 1,
      maxOutputTokens: 2048,
    },
    safetySettings: [
      { category: 'HARM_CATEGORY_HATE_SPEECH', threshold: 'BLOCK_MEDIUM_AND_ABOVE' },
      { category: 'HARM_CATEGORY_DANGEROUS_CONTENT', threshold: 'BLOCK_MEDIUM_AND_ABOVE' },
      { category: 'HARM_CATEGORY_SEXUALLY_EXPLICIT', threshold: 'BLOCK_MEDIUM_AND_ABOVE' },
      { category: 'HARM_CATEGORY_HARASSMENT', threshold: 'BLOCK_MEDIUM_AND_ABOVE' }
    ]
  };

  const response = await model.generateContent(request);
  
  if (!response.response.candidates?.[0]?.content?.parts?.[0]?.inlineData?.data) {
    throw new Error('No image data received from Vertex AI');
  }

  const base64Data = response.response.candidates[0].content.parts[0].inlineData.data;
  const imageBuffer = Buffer.from(base64Data, 'base64');
  
  // Add watermark to the generated image
  const watermarkedBuffer = await addWatermark(imageBuffer, LOGO_BASE64);
  
  // Convert back to base64 for storage and display
  const watermarkedBase64 = watermarkedBuffer.toString('base64');
  const filename = `jewelry-design-${Date.now()}.png`;

  // Upload to Google Cloud Storage
  const bucket = storage.bucket(process.env.GOOGLE_STORAGE_BUCKET);
  const file = bucket.file(`generated-images/${filename}`);
  
  await file.save(watermarkedBuffer, {
    metadata: {
      contentType: 'image/png',
      cacheControl: 'public, max-age=31536000',
    },
    predefinedAcl: 'publicRead'
  });

  const publicUrl = `https://storage.googleapis.com/${process.env.GOOGLE_STORAGE_BUCKET}/generated-images/${filename}`;
  const dataUrl = `data:image/png;base64,${watermarkedBase64}`;

  return {
    dataUrl,
    publicUrl,
    filename
  };
}

// Update your fallbackToStableDiffusion function similarly:
async function fallbackToStableDiffusion(prompt, referenceAnalysis = null) {
  const enhancedPrompt = enhanceJewelryPrompt(prompt, referenceAnalysis);
  
  console.log('Enhanced SD prompt:', enhancedPrompt);
  
  const response = await fetch('https://api.stability.ai/v1/generation/stable-diffusion-xl-1024-v1-0/text-to-image', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${process.env.STABILITY_API_KEY}`,
    },
    body: JSON.stringify({
      text_prompts: [
        {
          text: enhancedPrompt,
          weight: 1
        },
        {
          text: "blurry, low quality, distorted, amateur photography, poor lighting, cluttered background, unprofessional",
          weight: -0.5
        }
      ],
      cfg_scale: 7,
      height: 1024,
      width: 1024,
      samples: 1,
      steps: 30,
      style_preset: "photographic"
    }),
  });

  if (!response.ok) {
    const errorData = await response.text();
    console.error('Stability API error:', response.status, errorData);
    throw new Error(`Stability API error: ${response.status}`);
  }

  const result = await response.json();
  
  if (!result.artifacts || result.artifacts.length === 0) {
    throw new Error('No image generated by Stability AI');
  }

  const base64Data = result.artifacts[0].base64;
  const imageBuffer = Buffer.from(base64Data, 'base64');
  
  // Add watermark
  const watermarkedBuffer = await addWatermark(imageBuffer, LOGO_BASE64);
  const watermarkedBase64 = watermarkedBuffer.toString('base64');
  
  const filename = `jewelry-design-sd-${Date.now()}.png`;

  // Upload to Google Cloud Storage
  const bucket = storage.bucket(process.env.GOOGLE_STORAGE_BUCKET);
  const file = bucket.file(`generated-images/${filename}`);
  
  await file.save(watermarkedBuffer, {
    metadata: {
      contentType: 'image/png',
      cacheControl: 'public, max-age=31536000',
    },
    predefinedAcl: 'publicRead'
  });

  const publicUrl = `https://storage.googleapis.com/${process.env.GOOGLE_STORAGE_BUCKET}/generated-images/${filename}`;
  const dataUrl = `data:image/png;base64,${watermarkedBase64}`;

  return {
    dataUrl,
    publicUrl,
    filename
  };
}
